import React, { useState } from "react";

export default function Signup() {
    const [cabAgencyName, setCabAgencyName] = useState('');
    const [cabAgencyMobileNumber, setCabAgencyMobileNumber] = useState('');
    const [cabAgencyEmail, setCabAgencyEmail] = useState('');
    const [cabAgencyPassword, setCabAgencyPassword] = useState('');

    return (
        <div className="pt-3 container">
            <div className="row">
                <div className="col-4"></div>
                <div className="pt-5 col-4">
                    <h2>Cab Agency Registration</h2>
                    <form id="form-driver-signup" noValidate>
                        <div className="mb-3">
                            <label className="form-label">Cab Agency name</label>
                            <input type="text" required className="form-control" name="cabAgencyName" id="cabAgencyName" />
                            <div className="invalid-feedback">
                                Cab Agency Name is required.
                            </div>
                        </div>
                        <div className="mb-3">
                            <label className="form-label">Cab Agency MobileNumber</label>
                            <input type="text" required className="form-control" name="cabAgencyMobileNumber" id="cabAgencyMobileNumber" pattern="[0-9]{10}" title="Please enter a 10-digit mobile number (0-9) without spaces or special character" />
                            <div className="invalid-feedback">
                                Cab Agency Mobile Number is required.
                            </div>
                        </div>
                        <div className="mb-3">
                            <label className="form-label">Cab Agency Email</label>
                            <input type="email" required className="form-control" name="cabAgencyEmail" id="cabAgencyEmail" />
                            <div className="invalid-feedback">
                                Cab Agency Email is required.
                            </div>
                        </div>
                        <div className="mb-3">
                            <label className="form-label">Cab Agency Password</label>
                            <input type="password" required className="form-control" name="cabAgencyPassword" id="cabAgencyPassword" />
                            <div className="invalid-feedback">
                                Cab Agency Password is required.
                            </div>
                        </div>
                        <button type="submit" className="btn btn-primary">Register</button>
                    </form>
                </div>
            </div>
        </div>
    );
}
